(* ---------------- dup/del/merge/keep nonterminals --------------- *)

let duplicateNontermValueFunc (nontermId:int) (sval:tSemanticValue) : tSemanticValue =
begin
  match nontermId with
  | _ -> (
      sval
    )
end

let deallocateNontermValueFunc (nontermId:int) (sval:tSemanticValue) : unit =
begin
  match nontermId with
  | _ -> (
      ()
    )
end

let mergeAlternativeParsesFunc (nontermId:int) (left:tSemanticValue)
                               (right:tSemanticValue) : tSemanticValue =
begin
  match nontermId with
  | _ -> (
      (Printf.printf "WARNING: no action to merge nonterm %s\n"
                     nontermNamesArray.(nontermId));
      (flush stdout);
      left
    )
end

let keepNontermValueFunc (nontermId:int) (sval:tSemanticValue) : bool =
begin
  match nontermId with
  | _ -> (
      true
    )
end


(* ---------------- dup/del/classify terminals --------------- *)let duplicateTerminalValueFunc (termId:int) (sval:tSemanticValue) : tSemanticValue =
begin
  match termId with
  | _ -> (
      sval
    )
end

let deallocateTerminalValueFunc (termId:int) (sval:tSemanticValue) : unit =
begin
  match termId with
  | _ -> (
      ()
    )
end

let reclassifyTokenFunc (oldTokenType:int) (sval:tSemanticValue) : int =
begin
  match oldTokenType with
  | _ -> (
      oldTokenType
    )
end



